import React from 'react';

const Contact = () => {
    return (
        <div>
            <section id="contact">
                <div className="container-sm my-5 py-5">
                    <div className="row justify-content-center">
                        <div className="col-xs-6">
                            <h3 className="fs-5 text-center text-white">Contact</h3>
                            <p className="lead text-center text-white">Let's connect and create something amazing together!</p>
                            <a href="#" class="link-light text-right">Email</a>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default Contact;
